import blogs from "./Blogs";
function createBlog() {
  return (
    <Blog
      key={blogs.id}
      img={blogs.image}
      date={blogs.date}
      bHeading={blogs.bHeading}
    />
  );
}
function Blog(props) {
  return <div>{blogs.map(createBlog)} </div>;
}

export default App;
